    console.log('%c /**        //** **    **     //**    /**     /**   **    //    **    //     **//**     ', styleOptions);
    console.log('%c /*******    //***    /**      /**    /**     /**  /**         /**          **  //**    ', styleOptions);
    console.log('%c /**////      **/**   /**      /**    /**     /**  /**         /**         **********   ', styleOptions);
    console.log('%c /**         ** //**  //**     **     /**     /**  //**    **  //**    ** /**//////**   ', styleOptions);
    console.log('%c /********  **   //**  //*******      /**     /**   //******    //******  /**     /**   ', styleOptions);
    console.log('%c ////////  //     //    ///////       //      //     //////      //////   //      //    ', styleOptions);
    console.log('%c                                                                                        ', styleOptions);

}
